class Header extends React.Component {
    render() {
        return(
            <div className={styles.container}>
                <div className={styles.navigation}>
                    <div className={`${styles.navigationItem} ${styles.active}`}>WOMEN</div>
                    <div className={styles.navigationItem}>MEN</div>
                    <div className={styles.navigationItem}>KIDS</div>
                </div>
                <div className={styles.logo}>
                    <HeaderLogo/>
                </div>
                <div className={styles.actions}>
                    <div className={styles.actionsItem}>$</div>
                    <div>< HeaderBasket/></div>
                </div>
            </div>
        )
    }
}

